import React from 'react';
import { Link } from 'react-router-dom';
const Adminnav = () => {
    return ( 
        <div style={{borderRadius:"100px"}}className="  mt-4 container ">
   <ul class="nav justify-content-center">
  <li class="nav-item">
    <Link class="nav-link active bg-info ">Add product</Link>
  </li>
  <li class="nav-item">
    <Link class="nav-link" >All Products</Link>
  </li>
  <li class="nav-item">
    <Link class="nav-link">Users</Link>
  </li>
 
</ul>
        </div>
     );
}
 
export default Adminnav;
